const axios = require('axios');

const getWeahter = (lat, lon) => {
    return new Promise((resolve, reject) => {
        axios.get('/user?ID=12345')
            .then(function (response) {
                // handle success
                resolve(response)
                console.log(response);
            })
            .catch(function (error) {
                // handle 
                reject(error)
                console.log(error);
            })
    })
}

module.exports = {}
